function quicksort(arr) {
  if (arr.length == 0) return [];
  let left = [];
  let right = [];
  let pivot = arr[0];
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }
  return quicksort(left).concat(pivot, quicksort(right));
}
console.log(quicksort([2, 4, 5, 49, 63, 4, 5, 55, 2, 4, 43])); // [2, 2, 4, 4, 4, 5, 5, 43, 49, 55, 63]
