function fibonacci(n){
  var fibo = Array(0,1);
  if (n === 0) return 0;
 if (n <= 2) return 1;
 for(let i = 2; i<=n; i++){
  fibo[i] = fibo[i-1]+fibo[i-2]
 }
  return fibo[n];
}
fibonacci(12); //  = 144

//\u9012\u5F52\u65B9\u6CD5 O(2n)
function fibonacciX(n){
  if(n <= 1) {
      return n;
  } else {
      return fibonacciX(n-1) + fibonacciX(n-2);
  }
}
fibonacciX(15); //  = 610

//\u9012\u5F52\u65B9\u6CD5\u4E4B ES6\u7B80\u5199 O(2n)-
const fibonacciX = (n) =>  (n <= 1 ? n : fibonacciX(n-1) + fibonacciX(n-2))
fibonacciX(20); //  = 6765
