function unique(arr) {
  let len = arr.length;
  //\u53CC\u5C42\u5FAA\u73AF\uFF0C\u5916\u5C42\u5FAA\u73AF\u5143\u7D20\uFF0C\u5185\u5C42\u5FAA\u73AF\u65F6\u6BD4\u8F83\u503C\u3002\u503C\u76F8\u540C\u65F6\uFF0C\u5219\u5220\u53BB\u8FD9\u4E2A\u503C\u3002
  for (let i = 0; i < len; i++) {
    for (let j = i + 1; j < len; j++) {
      if (arr[i] === arr[j]) {
        arr.splice(j, 1);
        // splice \u4F1A\u6539\u53D8\u6570\u7EC4\u957F\u5EA6\uFF0C\u6240\u4EE5\u8981\u5C06\u6570\u7EC4\u957F\u5EA6 len \u548C\u4E0B\u6807 j \u51CF 1
        len--;
        j--;
      }
    }
  }
  return arr;
}
